import './divider.css'

const Divider = ({props}) =>(
    <>
        <div className='DividerContainer'>
            <h1>{props.title}</h1>
        </div>
        <hr className='DividerLine'>
            {props.children}
        </hr>
        <hr className='DividerLine'/>
    </>
)
